import pytest

from biodatagraph.parser import HGNCParser


class TestHGNCParser:

    def test_hgnc_parse_complete_file(self, tmp_path, hgnc_test_file):
        hgnc_parser = HGNCParser(tmp_path)

        hgnc_parser.parse_hgnc_complete_file(hgnc_test_file)

        for nodeset in hgnc_parser.container.nodesets:
            assert len(nodeset.nodes) > 0
        for relationshipset in hgnc_parser.container.relationshipsets:
            assert len(relationshipset.relationships) > 0


